import {NavLink } from 'react-router-dom'

export const  CategoryItem =({id, title, image}) =>{
  return (
    <NavLink to={`/category/${title}/${id}`} state={title}>
        <img src={image} alt="" />
        <div>
            {title}
        </div>
    </NavLink>
  )
}
